import React from "react";

const Home = () => {
    return(
    <div>
    <Stack sx={{ml: -10, mr: -10}} paddingTop='75px' textAlign='center' color={"text.primary"} bgcolor={"background.default"}>
        <h1 sx={{ml: 20, mr: 20}} padding="100px">Welcome</h1>
        <p sx={{ml: 20, mr: 20}}>This Website is a place to upload recipes, view other people's recipes, get feedback on recipes, and keep track of your fridge and pantry.</p>
        <Stack sx={{margin: "10px auto"}} textAlign='center' direction="row" spacing={5}>
            <Button variant="contained">Sign In</Button>
            <Button variant="contained">Register</Button>

        </Stack>
    </Stack>

    </div>
    );
}

export default Home;
